import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';

const TechniqueDetail = () => {
  const [technique, setTechnique] = useState(null);
  const [loading, setLoading] = useState(true);
  const [selectedEquipment, setSelectedEquipment] = useState(null);
  const { id } = useParams();
  const navigate = useNavigate();

  useEffect(() => {
    const fetchTechnique = async () => {
      try {
        const response = await fetch(`/api/techniques/${id}`);
        const data = await response.json();
        setTechnique(data);
      } catch (error) {
        console.error('Error fetching technique:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchTechnique();
  }, [id]);

  if (loading) {
    return (
      <div className="flex justify-center items-center h-64">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-nature-blue"></div>
      </div>
    );
  }

  if (!technique) {
    return (
      <div className="text-center py-12">
        <p className="text-gray-600">Technique non trouvée</p>
      </div>
    );
  }

  return (
    <div className="max-w-4xl mx-auto">
      <button
        onClick={() => navigate(-1)}
        className="mb-6 text-nature-blue hover:underline flex items-center"
      >
        ← Retour
      </button>

      <div className="bg-white rounded-lg shadow-lg overflow-hidden">
        <img
          src={technique.imageUrl}
          alt={technique.name}
          className="w-full h-64 object-cover"
        />

        <div className="p-6">
          <h1 className="text-3xl font-bold text-nature-blue mb-4">
            {technique.name}
          </h1>

          <div className="prose max-w-none mb-8">
            <h2 className="text-xl font-semibold mb-2">Description</h2>
            <p className="text-gray-700">{technique.description}</p>
          </div>

          <div className="mb-8">
            <h2 className="text-xl font-semibold mb-4">Équipement recommandé</h2>
            <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
              {technique.equipment.map((item) => (
                <div
                  key={item._id}
                  className="border rounded-lg p-4 cursor-pointer hover:border-nature-blue transition duration-200"
                  onClick={() => setSelectedEquipment(item)}
                >
                  <h3 className="font-semibold">{item.name}</h3>
                  <p className="text-sm text-gray-600">{item.description}</p>
                </div>
              ))}
            </div>
          </div>

          <div className="mb-8">
            <h2 className="text-xl font-semibold mb-4">Conseils saisonniers</h2>
            <div className="bg-gray-50 rounded-lg p-4">
              {technique.seasonalAdvice.map((advice, index) => (
                <div key={index} className="mb-2">
                  <span className="font-semibold">{advice.season}: </span>
                  {advice.advice}
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>

      {selectedEquipment && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
          <div className="bg-white rounded-lg p-6 max-w-md w-full mx-4">
            <div className="flex justify-between items-center mb-4">
              <h2 className="text-2xl font-bold">{selectedEquipment.name}</h2>
              <button
                onClick={() => setSelectedEquipment(null)}
                className="text-gray-500 hover:text-gray-700"
              >
                ✕
              </button>
            </div>
            <div className="space-y-4">
              <p>{selectedEquipment.description}</p>
              <div className="border-t pt-4">
                <h3 className="font-semibold mb-2">Caractéristiques :</h3>
                <ul className="list-disc list-inside">
                  {selectedEquipment.specifications.map((spec, index) => (
                    <li key={index}>{spec}</li>
                  ))}
                </ul>
              </div>
              <div>
                <p className="font-semibold">Prix estimatif :</p>
                <p>{selectedEquipment.estimatedPrice} €</p>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default TechniqueDetail;
